import React, { Component } from 'react';

class Practice extends Component {
    state = {  }
    render() { 
        const MyInfo = [
            {
                Fname:'Habibullah',
                Lname:'Tonoy',
                age:24,
                Gender:'male'
            },
            {
                Fname:'Habib',
                Lname:'Tonoy',
                age:23,
                Gender:'male'
            }
        ]
        return ( 
            <div className="tag">
                {MyInfo.map(info => {
                    return(
                        <div >
                            <h1>Name:{info.Fname} {info.Lname}</h1>
                            <span>Age: {info.age}</span>
                        </div>
                    );
                })}
            </div>
         );
    }
}

export default Practice;
